import React from "react";

const GitHub = () => {
  const mystyle = {
    textAlign: "left",
  };
  return (
    <div style={mystyle}>
      <h2>GitHub Repositories</h2>
      <p>
        Check out our GitHub repository for source code, issues, and
        contributions!
      </p>
    </div>
  );
};

export default GitHub;
